import React from "react";
import { Link } from "react-router-dom";
import { Image, Flex, Spacer } from "@chakra-ui/react";
import FeatureIcon from "../featureIcons";
import "./featureMenu.module.css";

const FeaturedMenu = () => {
  return (
    <Flex direction="column" justify="center">
      <Link to="/thumb">
        <FeatureIcon alt="thumbometer" src="/thumb.png" />
      </Link>
      <Spacer />
      <Link to="/raiseHand">
        <FeatureIcon alt="raisehand" src="/raisehand.jpeg" />
      </Link>
      <Spacer />
      <Link to="/livequiz">
        <FeatureIcon alt="livequiz" src="/quizzical.jpeg" />
      </Link>
    </Flex>
  );
};

export default FeaturedMenu;
